www-http:
  tcp:
    '80':
      desc: World Wide Web HTTP
      note: "This is a duplicate of the \"http\" service and should not be used for
        discovery purposes.\n      u=<username> p=<password> path=<path to document>\n
        \       (see txtrecords.html#http)\n        Known Subtypes: _printer\n        NOTE:
        The meaning of this service type, though called just \"http\", actually\n
        \       denotes something more precise than just \"any data transported using
        HTTP\".\n        The DNS-SD service type \"http\" should only be used to advertise
        content that:\n        * is served over HTTP,\n        * can be displayed
        by \"typical\" web browser client software, and\n        * is intented primarily
        to be viewed by a human user.\n        Of course, the definition of \"typical
        web browser\" is subjective, and may\n        change over time, but for practical
        purposes the DNS-SD service type \"http\"\n        can be understood as meaning
        \"human-readable HTML content served over HTTP\".\n        In some cases other
        widely-supported content types may also be appropriate,\n        such as plain
        text over HTTP, or JPEG image over HTTP.\n        Content types not intented
        primarily for viewing by a human user, or not\n        widely-supported in
        web browsing clients, should not be advertised as\n        DNS-SD service
        type \"http\", even if they do happen to be transported over HTTP.\n        Such
        types should be advertised as their own logical service type with their\n
        \       own DNS-SD service type, for example, XUL (XML User Interface Language)\n
        \       transported over HTTP is advertised explicitly as DNS-SD service type
        \"xul-http\"."
  udp:
    '80':
      desc: World Wide Web HTTP
      note: "This is a duplicate of the \"http\" service and should not be used for
        discovery purposes.\n      u=<username> p=<password> path=<path to document>\n
        \     (see txtrecords.html#http)\n      Known Subtypes: _printer\n      NOTE:
        The meaning of this service type, though called just \"http\", actually\n
        \     denotes something more precise than just \"any data transported using
        HTTP\".\n      The DNS-SD service type \"http\" should only be used to advertise
        content that:\n      * is served over HTTP,\n      * can be displayed by \"typical\"
        web browser client software, and\n      * is intented primarily to be viewed
        by a human user.\n      Of course, the definition of \"typical web browser\"
        is subjective, and may\n      change over time, but for practical purposes
        the DNS-SD service type \"http\"\n      can be understood as meaning \"human-readable
        HTML content served over HTTP\".\n      In some cases other widely-supported
        content types may also be appropriate,\n      such as plain text over HTTP,
        or JPEG image over HTTP.\n      Content types not intented primarily for viewing
        by a human user, or not\n      widely-supported in web browsing clients, should
        not be advertised as\n      DNS-SD service type \"http\", even if they do
